import { React } from 'react';
import NavBar from './components/NavBar/NavBar';
import Hero from './components/Hero/Hero';
import Particles from 'react-particles-js';
import About from './components/About/About'
import Projects from './components/ProjSec/Projects'
import Contact from './components/Contact/Contact'
import ToTopButton from './components/ToTopButton/ToTopButton';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import AboutMe from './components/MoreAboutMe/AboutMe'


function App() {
  return (
    <Router>
    <div>
      <NavBar />
      <Switch>
        <Route exact path='/' >
        <Particles id="particles-js"
      params={{
        particles: {
          number: {
            value: 400,
            density: {
              enable: true,
              value_area: 800
            }
          },
          color: {
            value: '#fff'
          },
          shape: {
            type: 'circle',
            stroke: {
              width: 0,
              color: '#ff0000'
            },
            polygon: {
              nb_sides: 5
            },
            image: {
              src: '',
              width: 100,
              height: 100
            }
          },
          opacity: {
            value: 1,
            random: false,
            anim: {
              enable: false,
              speed: 2,
              opacity_min: 0,
              sync: false
            }
          },
          size: {
            value: 20,
            random: false,
            anim: {
              enable: false,
              speed: 20,
              size_min: 0,
              sync: false
            }
          },
          line_linked: {
            enable: true,
            distance: 100,
            color: '#fff',
            opacity: 1,
            width: 1
          },
          move: {
            enable: true,
            speed: 2,
            direction: 'none',
            random: false,
            straight: false,
            out_mode: 'out',
            bounce: false,
            attract: {
              enable: false,
              rotateX: 3000,
              rotateY: 3000
            }
          },
          array: []
        },
        interactivity: {
          detect_on: 'canvas',
          events: {
            onhover: {
              enable: true,
              mode: 'grab'
            },
            onclick: {
              enable: true,
              mode: 'push'
            },
            resize: true
          },
          modes: {
            grab:{
              distance: 100,
              line_linked:{
                opacity: 1
              }
            },
            bubble:{
              distance: 200,
              size: 80,
              duration: 0.4
            },
            repulse:{
              distance: 200,
              duration: 0.4
            },
            push:{
              particles_nb: 4
            },
            remove:{
              particles_nb: 2
            }
          },
          mouse:{}
        },
        "retina_detect": true}} />
          <Hero />
          <About />
          <Projects />
          <Contact />
        </Route>
        <Route exact path='/about'>
          <AboutMe />
        </Route>
      </Switch>
      <ToTopButton />
    </div>
    </Router>
  );
}



export default App;
